import React, { useState } from 'react';

function Home() {
  const [showHours, setShowHours] = useState(false);

  return (
    <div style={styles.homeContainer}>
      <div style={styles.homeOverlay}></div> {/* Overlay for readability */}
      <div style={{ ...styles.homeContent, textAlign: 'left', marginLeft: '-550px' }}>
        <h1>Experienced quality medical services to rely on!</h1>
        <h2>Your health is our priority.</h2>
        <p>
          At DoctorApp, we bring you exceptional healthcare services tailored to meet your unique needs. 
          With an experienced team of professionals and state-of-the-art facilities, you can trust us to be with you 
          every step of your healthcare journey.
        </p>
      </div>

      {/* Opening Hours Section */}
      <div style={styles.toggleHours}>
        <button
          style={styles.toggleHoursButton}
          onClick={() => setShowHours((prev) => !prev)}
        >
          {showHours ? 'Hide Opening Hours' : 'Show Opening Hours'}
        </button>
        {showHours && (
          <div style={styles.hoursBox}>
            <p>üïí Monday - Friday: 8:00 AM - 9:00 PM</p>
            <p>üïí Saturday: 9:00 AM - 6:00 PM</p>
            <p>üïí Sunday: 9:00 AM - 2:00 PM</p>
          </div>
        )}
      </div>

      {/* Additional Sections */}
      <div style={{ marginTop: '50px', textAlign: 'center' }}>
        <h3 style={{ fontSize: '24px', marginBottom: '20px' }}>Why Choose Us?</h3>
        <div>
          <div style={styles.featureItem}>
            <h4>üë®‚Äç‚öïÔ∏è Expert Doctors</h4>
            <p>Our team consists of highly skilled professionals dedicated to providing the best care possible.</p>
          </div>
          <div style={styles.featureItem}>
            <h4>üè• Advanced Facilities</h4>
            <p>We use the latest technology and state-of-the-art equipment for accurate diagnosis and treatment.</p>
          </div>
          <div style={styles.featureItem}>
            <h4>üìû 24/7 Support</h4>
            <p>Access our services anytime with our round-the-clock support team ready to assist you.</p>
          </div>
        </div>
      </div>

      {/* Footer Section */}
      <footer style={styles.footer}>
        <div>
          <p>&copy; 2024 DoctorApp. All rights reserved.</p>
          <p>
            <a href="/terms" style={styles.link}>Terms of Service</a> |{' '}
            <a href="/privacy" style={styles.link}>Privacy Policy</a>
          </p>
        </div>
      </footer>
    </div>
  );
}

// Inline styles
const styles = {
  homeContainer: {
    padding: '20px',
    backgroundColor: '#f4f4f4',
    position: 'relative',
  },
  homeOverlay: {
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
    height: '100%',
    width: '100%',
    position: 'absolute',
    zIndex: -1,
  },
  homeContent: {
    position: 'relative',
    padding: '20px',
  },
  toggleHours: {
    marginTop: '20px',
    textAlign: 'center',
  },
  toggleHoursButton: {
    padding: '10px 20px',
    fontSize: '16px',
    backgroundColor: '#007bff',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    transition: 'background-color 0.3s',
  },
  toggleHoursButtonHover: {
    backgroundColor: '#0056b3',
  },
  hoursBox: {
    marginTop: '10px',
    backgroundColor: '#e3f2fd',
    padding: '15px',
    borderRadius: '8px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    textAlign: 'center',
    maxWidth: '400px',
    margin: '0 auto',
  },
  featureItem: {
    marginBottom: '20px',
  },
  footer: {
    marginTop: '50px',
    textAlign: 'center',
    padding: '10px',
    backgroundColor: '#f8f9fa',
  },
  link: {
    color: '#007bff',
    textDecoration: 'none',
  },
};

export default Home;
